import React from "react";
import ExpencseDes from "../main/components/ExpencseDes";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Expence = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };
  return (
    <div className="relative" id="images">
      <div className="bg-[#F6F7F9] flex flex-col lg:flex-row justify-center lg:justify-evenly mt-8 lg:mt-24 lg:h-[426px] p-4 lg:p-0">
        <div className="flex flex-col items-center lg:items-start mr-0 lg:mr-20">
          <h1 className="text-[#ADB3BE] contrast-50 font-semibold mt-4 lg:mt-0 lg:text-4xl">
            SAVE TIME AND MONEY
          </h1>
          <p className="text-[#050F4E] text-lg lg:text-4xl mt-4 lg:mt-8">
            Find My Trials reduces expenses, accelerates research, and yields
            quicker advancements, ultimately saving both time and money.
          </p>
        </div>
        <div className="mt-8 lg:mt-0">
          <img
            src="images/Group.png"
            alt="group"
            className="w-full max-w-sm lg:max-w-none"
          />
        </div>
        <div className="mt-8 lg:mt-0">
          <img
            src="images/Group1.png"
            alt="group"
            className="w-full max-w-sm lg:max-w-none"
          />
        </div>
      </div>
      <Slider
        {...settings}
        className="absolute bottom-16 lg:bottom-28 w-full max-w-6xl mx-auto"
      >
        {[1, 2, 3].map((index) => (
          <div key={index}>
            <ExpencseDes />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Expence;
